import React, { Component } from 'react';
import { connect } from 'react-redux';

const Tooltip = (props) => {
	const {
		title,
		subtitle,
	} = props;

	return (
		<div 
			className="tooltip"
		>
			<header>
				<h3>{ title }</h3>
				<span>{ subtitle }</span>
			</header>
		</div>
	)
}

const mapStateToProps = state => ({
	manifest: state.manifest,
	weapon: state.weapon,
});

export default connect(mapStateToProps, {

})(Tooltip);
